import { useState} from "react";
import Form from 'react-bootstrap/Form';
import data from "../data.js";


function Main (){

    return(
    <div>
    <h1>심리테스트</h1>
    <br/>
    {
    data.map(function(test){
        return(
            <div style={{whiteSpace : 'pre-wrap'}}> 
            <h4>{test.text}</h4>
            <br/>
            <h4 >
          <Form.Radio
            inline
            label="아니다"
            name={`radio_${test.id}`} 
            value="아니다"
          />
          <Form.Radio
            inline
            label="그저그렇다"
            name={`radio_${test.id}`} 
            value="그저그렇다"
          />
          <Form.Radio
            inline
            label="그렇다"
            name={`radio_${test.id}`} 
            value="그렇다"
          />
          <Form.Radio
            inline
            label="매우그렇다"
            name={`radio_${test.id}`}
            value="매우그렇다"
          />
          </h4>
          <br/>
          </div>
        )
        
    })}
      
    </div>
    )
}

